// src/App.js
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // Importing necessary components
import Login from "./pages/Login"; // Adjust the path to your actual file structure
import Home from "./pages/Home"; // Adjust the path to your actual file structure
import MedicineAdd from "./pages/MedicineAdd";
import MedicineManage from "./pages/MedicineManage";
import ForgotPassword from "./pages/Forgotpassword";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/" element={<ForgotPassword />} />
          <Route path="home" element={<Home />} />
          <Route path="medicineAdd" element={<MedicineAdd/>}/>
          <Route path="MedicineManage" element={<MedicineManage/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
